  }

  render() {
    let portfolioStyle = {
      fontSize: '1.2em'
    }

    return (
      <div id="portfolio" className={"container-md"} style={portfolioStyle}>
        <Header />
        <Skills />
        <hr/>
        <Projects />
        <hr/>
        <Github />
